et depressed but the opposite.To be really joyful.To be really grateful. For this one day alive. To appreciate every moment of this life. In order to be really AWAKE to this moment and be present in every interaction.The practice of mindfulness, is a practice to be one with what we do in each moment. The Buddhist say: when I walk I walk, when I eat I eat when I wash the dishes I wash the dishes. So that in the end of this life you won‚Äôt have the feeling of ‚ÄöDamn I missed my life‚Äò. Life is beautiful and life is brutal. Life is joyful and life is painful.To love means to hold both of these realities at the same time.To open our heart to another being holds in itself the possibility for heartbreak, the day we have to let go. To hold our hearts wide open to the reality of love and pain is the practice of life. May we continue to love even when our heart feel broken. The taste of life, is bitter sweet. Please love as much as you can.Tell people how much you care and spend more time cuddling your dog then scolling on your phone. Its your life, NOW! #presciouslife #now #mindfulness #letgo";}i:82;a:1:{s:14:"comments_count";i:0;}i:83;a:1:{s:11:"likes_count";i:21;}i:84;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuVKx7BP6B";}i:85;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118718614_346756650041061_6406847035500958283_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=2IKDb_fDlM4AX_GvLNe&_nc_tp=18&oh=9fa2985f0868b79cac482285d1beed41&oe=5F7C9A82";}i:86;a:1:{s:4:"type";s:5:"image";}i:87;a:1:{s:8:"owner_id";i:1065435597;}i:88;a:1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2390941854903042708";}i:92;a:1:{s:10:"short_code";s:11:"CEuVPMEHAKU";}i:93;a:1:{s:12:"created_time";i:1599242501;}i:94;a:1:{s:7:"caption";s:310:"üíµüí∞üíµüí∞üíµ #motivation #money #investment #wow #marketing #advertising #consulting #dream #bored #motivat